import React from 'react';
import '../../App.css';
import {Card, CardBody, CardTitle, CardSubtitle, CardText, CardGroup, Row, Col} from "reactstrap";

const FounderBio = () => {


    return(
        <div className="d-flex justify-content-center founderContainer">
            <Row className="founderrow d-flex justify-content-center shadow-sm" >
                <Col sm="6"  >
                    <Card body outline color="white" className="founder-col">
                    <CardTitle className='founderquote'>We should have a more effective way <span className="founderspam">to help to keep each other safe.</span>
                                That&apos;s how Safe circle started. </CardTitle>
                    <CardText className="text-muted founderCardQuote">Ana Araújo, Founder</CardText>
                    </Card>
                </Col>
                <Col sm="6">
                    <Card  body outline color="white" >
                    <CardTitle className='spacer'>&nbsp;<br/>&nbsp;</CardTitle>
                    <CardText>When I lived in LA and used to go on online dates or to meet up with freelance clients, I felt unsafe and scared many many times. I used to text friends with info and say “well, if I don&apos;t text you saying that I am alive by this time, you know where to start searching for me”. But of course we often forgot to check in on each other - which would be a big problem if something were to happen. So I decided that we should have a more effective way to help to keep each other safe - That&apos;s how Safe circle started.</CardText>
                    </Card>
                </Col>
            </Row>
        </div>
    )
};

export default FounderBio;
